import React from 'react';

const VolumeSlider = (props) => {
  console.log("Rendering VolumeSlider");
    return(
      <div onClick={props.changeVol}> 
        <input type='range' min='0' max='100'  className='volSlider'></input>
      </div>    
    )
}

export default VolumeSlider;
